import{_ as r,c as a,o,ag as t}from"./chunks/framework.Bw-5EFTY.js";const u=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"分子模拟/背景知识/对接软件汇总.md","filePath":"分子模拟/背景知识/对接软件汇总.md","lastUpdated":null}'),l={name:"分子模拟/背景知识/对接软件汇总.md"};function i(n,e,c,s,h,k){return o(),a("div",null,e[0]||(e[0]=[t('<h2 id="蛋白质对接" tabindex="-1">蛋白质对接 <a class="header-anchor" href="#蛋白质对接" aria-label="Permalink to &quot;蛋白质对接&quot;">​</a></h2><h3 id="zdock" tabindex="-1">ZDOCK <a class="header-anchor" href="#zdock" aria-label="Permalink to &quot;ZDOCK&quot;">​</a></h3><ul><li>ZDOCK和M-ZDOCK都是基于快速傅立叶变换的蛋白质相互作用对接程序，该程序由马萨诸塞大学医学院的Zhiping Weng的实验室（ZLAB）提供并维护。<a href="https://zlab.umassmed.edu/zdock/index.shtml" target="_blank" rel="noreferrer">ZDOCK: Protein Docking (umassmed.edu)</a></li><li>ZDOCK程序主要用来搜索两种蛋白质之间通过平移和旋转而得到的空间中所有可能的相互结合模式，并使用基于能量的评分函数评估每个结合模型。ZDOCK程序对于学术用户是免费使用的，同时其也集成到了很多的商业化软件中。作为学术用户可以通过其官方网站填写邮箱地址获取学术版的下载地址。<a href="https://zdock.wenglab.org/software/" target="_blank" rel="noreferrer">Protein Docking Software (ZDOCK &amp; RDOCK) (wenglab.org)</a></li><li>提供了几种蛋白质对接算法，包括： <ul><li><strong>ZDOCK</strong>: 对两种蛋白质之间的对接方向进行完整的<strong>刚体搜索</strong>。目前版本ZDOCK 3.0.2，使用IFACE统计势能，结构互补和静电等构成的打分函数</li><li><strong><a href="http://zlab.umassmed.edu/m-zdock" target="_blank" rel="noreferrer">M-ZDOCK</a></strong>: ZDOCK 的修改，用于使用亚基结构预测对称组装。</li><li><strong>ZRANK</strong>: 一个对接改进程序，旨在对初始阶段对接（例如来自 ZDOCK）的模型以及改进的对接模型（例如来自 RosettaDock）提供快速准确的重新评分。</li><li><strong>RDOCK</strong>: 一种较旧的对接优化协议，它利用了初始阶段对接模型的结构最小化和重新评分。</li></ul></li><li>web serve：<a href="https://zdock.umassmed.edu/" target="_blank" rel="noreferrer">ZDOCK Server: An automatic protein docking server (umassmed.edu)</a></li><li>注意：ZDOCK<strong>只支持蛋白质分子</strong></li></ul><h3 id="rosetta" tabindex="-1">Rosetta <a class="header-anchor" href="#rosetta" aria-label="Permalink to &quot;Rosetta&quot;">​</a></h3><ul><li>RosettaDock 是一个用于“蛋白质-蛋白质”或“蛋白质-配体”相互作用的计算机模拟和蛋白质结构预测的软件工具，它是<a href="https://www.rosettacommons.org/" target="_blank" rel="noreferrer">Rosetta</a>软件套件的一部分。</li><li>Rosetta 是一个广泛用于蛋白质结构预测、蛋白质折叠、蛋白质-蛋白质和蛋白质-配体相互作用等生物信息学任务的计算生物学工具。</li><li><a href="https://rosie.graylab.jhu.edu/docking" target="_blank" rel="noreferrer">[ROSIE] Docking Protocol (jhu.edu)</a></li></ul><h3 id="gramm" tabindex="-1">GRAMM <a class="header-anchor" href="#gramm" aria-label="Permalink to &quot;GRAMM&quot;">​</a></h3><ul><li>刚体对接，来自<a href="https://vakserlab.ku.edu/" target="_blank" rel="noreferrer">Vakser Lab|Research (ku.edu)</a></li><li>web serve：<a href="https://gramm.compbio.ku.edu/" target="_blank" rel="noreferrer">Vakser Lab - GRAMM Web (ku.edu)</a>，教育邮箱即可使用。</li></ul><h3 id="hex-protein-docking" tabindex="-1">Hex Protein Docking <a class="header-anchor" href="#hex-protein-docking" aria-label="Permalink to &quot;Hex Protein Docking&quot;">​</a></h3><ul><li>Hex 是一个交互式蛋白质对接和分子叠加程序，假设配体是刚性的，Hex 还可以计算蛋白质-配体对接，并且它可以仅使用分子对的 3D 形状知识来叠加分子对。是唯一一个使用球形极傅里叶 （SPF） 相关性来加速计算的对接和超级定位程序，第一个能够使用现代图形处理器单元 （GPU） 来加速计算的蛋白质对接程序。</li><li>官网：<a href="https://hex.loria.fr/" target="_blank" rel="noreferrer">Hex Protein Docking (loria.fr)</a></li><li>可以是非蛋白质</li></ul><h3 id="patchdock-and-symmdock-and-firedock" tabindex="-1">PatchDock and SymmDock and FireDock <a class="header-anchor" href="#patchdock-and-symmdock-and-firedock" aria-label="Permalink to &quot;PatchDock and SymmDock and FireDock&quot;">​</a></h3><ul><li>PatchDock 方法可对蛋白质-蛋白质和蛋白质-小分子复合物进行结构预测（基于形状互补原理的分子对接算法）。输入是任何类型的两个分子：蛋白质、DNA、肽、药物。输出是按形状互补性标准排序的潜在复合物列表。</li><li>SymmDock 方法在给定单体单元的结构的情况下预测具有循环对称性的同源多聚体的结构。</li><li>web serve：<a href="https://www.cs.tau.ac.il/~ppdock/PatchDock/" target="_blank" rel="noreferrer">PatchDock Server: An Automatic Server for Molecular Docking (tau.ac.il)</a>，用不了</li><li>下载：<a href="https://bioinformaticsreview.com/20210709/installing-patchdock-on-ubuntu-linux/" target="_blank" rel="noreferrer">Installing PatchDock on Ubuntu (Linux) — Bioinformatics Review</a>，报错（Segmentation fault (core dumped)）</li><li>FireDock：用于蛋白质-蛋白质对接结果的灵活精炼和评分。先执行 PatchDock 刚体对接，再通过 FireDock 对结果进行重定向以进行优化和评分。</li></ul><h3 id="rxdock" tabindex="-1">RxDock <a class="header-anchor" href="#rxdock" aria-label="Permalink to &quot;RxDock&quot;">​</a></h3><ul><li>rDock为ZDock的升级算法</li><li>RxDock 是一个快速且多功能的开源对接程序，可用于对接小分子与蛋白质、核酸。RxDock 是 rDock （GitLab） 的一个分支，目标是更新代码以在现代计算机系统（包括超级计算机）上运行并实现跨平台使用。</li><li>官网：<a href="https://rxdock.gitlab.io/" target="_blank" rel="noreferrer">RxDock – modern, actively maintained, and cross-platform fork of rDock</a></li><li>对比：<a href="https://rdock.gitlab.io/" target="_blank" rel="noreferrer">rDock and RxDock – fast, versatile, and open-source programs for docking ligands to proteins and nucleic acids</a></li></ul><h3 id="rpxdock" tabindex="-1">RPXDock <a class="header-anchor" href="#rpxdock" aria-label="Permalink to &quot;RPXDock&quot;">​</a></h3><ul><li>在各种对称架构中进行序列无关的刚体蛋白对接，用于在多个对称架构中对称蛋白质复合物进行建模、采样和评分。</li><li>官网：<a href="https://github.com/willsheffler/rpxdock" target="_blank" rel="noreferrer">GitHub - willsheffler/rpxdock: protein docking stuff</a></li></ul><h3 id="其它" tabindex="-1">其它 <a class="header-anchor" href="#其它" aria-label="Permalink to &quot;其它&quot;">​</a></h3><ul><li>FlexDock：是一种用于灵活铰链弯曲蛋白质-蛋白质对接的算法，<a href="https://github.com/opencollab/flexdock" target="_blank" rel="noreferrer">opencollab/flexdock (github.com)</a></li><li>UCSF DOCK</li><li>FLIPDock</li><li>EADock</li><li>HADDOCK 2.2：可以做大分子与大分子对接，<a href="https://bioinformaticsreview.com/20210708/protein-protein-docking-using-haddock2-4-web-server/" target="_blank" rel="noreferrer">Protein-protein docking using HADDOCK2.4 web server — Bioinformatics Review</a></li><li>SwissDock：用于进行蛋白质与小分子之间相互作用的模拟，<a href="https://www.swissdock.ch/" target="_blank" rel="noreferrer">SwissDock</a></li><li>ClusPro：蛋白质-蛋白质刚体对接，只接受蛋白质文件，<a href="https://cluspro.org/help.php" target="_blank" rel="noreferrer">ClusPro 2.0: protein-protein docking</a></li><li>CHDOCK：许多蛋白质（如离子通道）是由对称的同源寡聚体形成的，是一种用于建模 Cn 对称同源寡聚物复合物的分层对接方法，来预测 Cn 对称蛋白质复合物的结构，类似SymmDock、M-ZDOCK、SAM。</li><li>HSYMDOCK，web serve：<a href="http://huanglab.phys.hust.edu.cn/hsymdock/" target="_blank" rel="noreferrer">HSYMDOCK Server (hust.edu.cn)</a></li><li>GalaxyTongDock：对称和非对称 ab initio 蛋白质-蛋白质对接，类似ZDOCK</li></ul>',17)]))}const f=r(l,[["render",i]]);export{u as __pageData,f as default};
